import React from 'react';
import logo from './logo.svg';
import './App.css';
import Nofication from './components/notification';
import BudgetForm from './components/BudgetForm';
import { BudgetList } from './components/BudgetList';

function App() {
  return (
    <div className="App">
      <Nofication />
      <BudgetForm />
      <BudgetList/>
    </div>
  );
}

export default App;
